import Foundation

class Solution {
    enum DIRECTION: String {
        case LEFT = "L", RIGHT = "R", MIDDLE = ".", NONE
    }
    
    
    func pushDominoes(_ dominoes: String) -> String {
        var dp = [DIRECTION.LEFT: [Int](), DIRECTION.RIGHT: [Int]()]
        var ans = Array(dominoes)
        
        for index in 0..<dominoes.count {
            if ans[index] == "L" {dp[.LEFT]?.append(index)}
            else if ans[index] == "R" {dp[.RIGHT]?.append(index)}
        }
        
        
        var changed = true
        while changed {
            changed = false
            let ori = ans
            var leftArr = [Int]()
            var rightArr = [Int]()
            
            for (dir, indexArr) in dp {
                if dir == .LEFT {
                    for index in indexArr {
                        let pointer = index-1
                        if pointer >= 0 {
                            if ori[pointer] == "." {
                                if pointer > 1 && ori[pointer - 1] == "R" {continue}
                                ans[pointer] = Character("L")
                                leftArr.append(pointer)
                                changed = true
                            }
                        }
                    }
                } else {
                    for index in indexArr {
                        let pointer = index+1
                        if pointer < ori.count {
                            if ori[pointer] == "." {
                                if pointer < ori.count-1 && ori[pointer + 1] == "L" {continue}
                                ans[pointer] = Character("R")
                                rightArr.append(pointer)
                                changed = true
                            }
                        }
                    }
                }
                
            }
            dp[.LEFT] = leftArr
            dp[.RIGHT] = rightArr
            
        }
        return String(ans)
    }
}

